import java.util.StringTokenizer;
import java.util.ArrayList;

public class Main {

    public static void main(String[] args) throws Exception {
        String input = "\n" +
                "\n" +
                "\n" +
                "\n" +
                "";

        StringTokenizer st = new StringTokenizer(input, " \t\n\r\f,");

        int[][] old_pad = new int[][]{
                {1,2,3},
                {4,5,6},
                {7,8,9}
        };

        char [][] pad = new char[][]{
                {'0', '0', '1', '0', '0'},
                {'0', '2', '3', '4', '0'},
                {'5', '6', '7', '8', '9'},
                {'0', 'A', 'B', 'C', '0'},
                {'0', '0', 'D', '0', '0'}
        };

        String code = "";

        int x = 0;
        int y = 2;

        int MAX_X = 4;
        int MAX_Y = 4;

        while (st.hasMoreTokens()) {
            String line = st.nextToken();
            for(int i = 0; i < line.length(); i++){
                char direction = line.charAt(i);

                switch (direction){
                    case 'D':
                        if(y + 1 <= MAX_Y && pad[y + 1][x] != '0')
                            y++;
                        break;
                    case 'U':
                        if (y - 1 >= 0 && pad[y - 1][x] != '0')
                            y--;
                        break;
                    case 'R':
                        if (x + 1 <= MAX_X && pad[y][x + 1] != '0')
                            x++;
                        break;
                    case 'L':
                        if (x - 1 >= 0 && pad[y][x - 1] != '0')
                            x--;
                        break;
                }
            }
            code += pad[y][x];
        }
        System.out.println("The code is:" + code);

    }

}

